import React, { Component } from 'react';

class ListUserComponent extends Component {
    constructor(props){
        super(props)

        this.state = {
            userEntity: []
        }
    }
    render() {
        return (
            <div>
                <h2 className="text-center">User List</h2>
                <div className="row">
                    <table className="table table-striped table-bordered">

                        <thead>
                            <tr>
                                <th>User username</th>
                                <th>User password</th>
                                <th>User phone</th>
                                <th>User email</th>
                                <th>User status</th>
                                <th>User role</th>
                                <th>User avatar</th>

                            </tr>
                        </thead>


                    </table>
                </div>

            </div>
        );
    }
}

export default ListUserComponent;
